package string;

import java.util.Arrays;
import java.util.HashMap;

// 两个字符串包含的字符是否完全相同
// https://leetcode-cn.com/problems/valid-anagram/description/
public class E_242 {
    public static void main(String[] args) {
        E_242 e = new E_242();
        String s = "anagram";
        String t = "nagaram";
        String s1 = "rat";
        String t1 = "car";
        String s2 = "";
        String t2 = "";
        boolean res1 = e.isAnagram(s2, t2);
        System.out.println(res1);
        boolean res2 = e.isAnagram2(s2, t2);
        System.out.println(res2);
    }

    //我的方法：用hashmap
    public boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }
        char[] cs = s.toCharArray();
        char[] ct = t.toCharArray();
        HashMap<Character, Integer> maps = new HashMap<>();
        HashMap<Character, Integer> mapt = new HashMap<>();
        for (int i = 0; i < cs.length; i++) {
            maps.put(cs[i], maps.getOrDefault(cs[i], 0) + 1);
            mapt.put(ct[i], mapt.getOrDefault(ct[i], 0) + 1);
        }
        for (char c : maps.keySet()) {
            if (!maps.get(c).equals(mapt.get(c))) { //注意，此处是Integer类型，故比较的话，要强转成int或像此处一样进行比较
                return false;
            }
        }
        return true;
    }

    //大神的想法：反正就26个字母，放入数组即可
    //而且，它的思路不是跟我上面类似的那种，他只用一个数组哦
    //官方的方法类似，不过节省一次遍历，而且有优化的方法
    public boolean isAnagram2(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }
        int[] array = new int[26];
        for (char cs : s.toCharArray()) {
            array[cs - 'a']++;  //这里的[cs-'a']来获得数组下标的方法也是很巧妙哦
        }
        for (char ct : t.toCharArray()) {
            array[ct - 'a']--; //这里真是很巧妙了呀
        }

        for (int i : array) {
            if (i != 0) {
                return false;
            }

        }
        return true;
    }

    //官方方法一；
    public boolean isAnagram3(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }
        int[] array = new int[26];
        for (int i = 0; i < s.length(); i++) {
            array[s.charAt(i) - 'a']++;
            array[t.charAt(i) - 'a']--; //将这两处放在一起
        }
        for (int i = 0; i < 26; i++) {
            if (array[i] != 0) {
                return false;
            }
        }
        return true;
    }

    //官方方法二：对方法一进行了优化
    public boolean isAnagram4(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }
        int[] array = new int[26];
        for (int i = 0; i < s.length(); i++) {
            array[s.charAt(i) - 'a']++;
        }
        for (int i = 0; i < t.length(); i++) {
            array[t.charAt(i) - 'a']--;
            if (array[t.charAt(i) - 'a'] < 0) {
                return false;
            }
        }
        return true;
    }

    //官方还有一个方法,不过时间复杂度多了些：其中排序是Olog(n),可忽略不计的比较是O(n)
    //思路，都排好序，比较排好序后是否相同
    public boolean isAnagram5(String s,String t){
        if (s.length() != t.length()) {
            return false;
        }
        char[] s1 = s.toCharArray();
        char[] t1 = t.toCharArray();
        Arrays.sort(s1);
        Arrays.sort(t1);
        return Arrays.equals(s1,t1);
    }
}
